INSERT INTO `xf_fire_detailed` VALUES ('2.0155300001e+013', '云南消防总队-昆明市消防支队-呈贡县消防大队-呈贡县消防中队', '出动', '', '昆明金勇棉絮厂（潘金勇）', '县城城区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-呈贡县消防大队', '工业建筑', '单层', '四级以下', '其他', '否', '否', '否', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '1555.00', '4.00', '其他(设置、管理等不符合规定)', '未安装', '其他(设置,管理不符合规定)', '未联网', '棉、麻、丝纤维', '否', '2015年4月21日20时至21时，呈贡区龙城街道出现雷暴天气现象，昆明金勇棉絮厂1号机器南面仓库门洞上方屋面彩钢板被雷电击中，引燃附着其表面的棉絮屑，继而引燃仓库门洞门垛处的棉花，蔓延扩大成灾。2014年4月21日20时44分，昆明市公安消防支队调集7个消防中队，20辆消防车，93名官兵赶赴火灾现场，23时30分将明火扑灭。火灾烧毁一间彩钢板厂房及石棉瓦房仓库一间,烧毁两台棉絮加工机器和两台切断机及棉絮加工材料若干。受灾1户，无人员伤亡。', '0.00', '0', '1555.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
