INSERT INTO `xf_fire_detailed` VALUES ('20155300000147', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防一中队', '出动', '', '高思勇', '集镇镇区', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '居住建筑', '多层', '四级以下', '其他', '否', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '', '', '', '', '电器具、设备', '否', '2015年1月23日17时32分，接报警昆明市官渡区大板桥街道办事处二甲村高思勇户发生火灾，火灾造成1人(高思勇，男，55岁，汉族，身份证号码：530112196012220011，籍贯：云南省昆明市五华区滇缅大道2626号）死亡，过火面积约95平方米，火灾烧损民房、家具、电器等物品，火灾直接财产损失1603084元，经现场勘验和对火灾相关当事人询问，起火部位位于三立电器经营部储物间内，起火原因系储物间内距西墙1.4M北墙3.1M处电气线路短路，引燃周边纸箱，蔓延扩大成灾。', '300.00', '0', '95.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
