INSERT INTO `xf_fire_detailed` VALUES ('20155300000677', '云南消防总队-昆明市消防支队-安宁市消防大队-安宁市消防中队', '出动', '云南华天物流有限公司', '', '其它(其他)', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-安宁市消防大队', '公共建筑', '多层', '二级', '砖混结构', '否', '否', '是', '不需要安装', '其他(未启动)', '不需要安装', '无效', '不需要安装', '其他(未启动)', '局部安装', '无效', '0.00', '0.00', '', '', '', '', '竹、木等制品及原料', '人身保险', '2015年3月17日12时15分左右，云南华天物流有限公司办公楼第一层展示间内处于长期通电状态的沙盘模型，本身故障导致模型内线路短路，引燃沙盘模型并迅速燃烧到墙面铝塑板等装修材料，过火面积400平米，火灾造成3人（李明，男，46岁，身份证号： 530103196906210350；李千寻，女，29 岁，身份证号：530181198609233984 ；夏宏飞，女，26岁，身份证号：530181198910132664 ）死亡、1人（马永岗，男，38岁，身份证号：532101197703100913）受伤（伤情为：左右小腿粉碎性骨折，伤情鉴定为轻伤九级）。火灾烧损了办公楼一层的沙盘展示间、财务室、会议室和二层行政办公室、总经理办公室等房间，烧毁了办公桌椅、电脑设备、打印机等物品以及建筑内外铝塑板等装修材料，过火面积400㎡，直接财产损失经云南消防司法鉴定中心鉴定为壹拾捌万柒仟零壹拾叁元。', '100000.00', '0', '400.00', '0', '已挂接', '无案例', '重大火灾', '较大火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20155300001025', '云南消防总队-昆明市消防支队-特勤大队-特勤一中队', '出动', '', '段平', '城市市区', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-西山区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '未联网', '其他', '财产保险', '2015年4月27日03时36分，昆明市西山区公安消防大队接到昆明市公安消防支队119指挥中心转警，二环南路福海立交桥上层辅道汽车起火。火灾烧毁一辆车牌号为云AL0E63，车架号为WDCDA6CB2FA454018的梅赛德斯奔驰ML320中大型SUV汽车车头，未造成人员伤亡，起火原因可排除放火、自燃、雷击、车辆内部电气线路故障等引发火灾的可能，不排除燃放烟花爆竹等引发火灾的可能。', '300.00', '0', '1.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
