INSERT INTO `xf_fire_detailed` VALUES ('20155300001916', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防二中队', '出动', '', '陈红伟', '城市市区', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '', '多层', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '未联网', '棉、麻、丝纤维', '否', '2015年8月23日15时42分，接报警昆明市官渡区十二棵橡树庄园11栋1单元发生火灾，无人员伤亡，过火面积160平方米，火灾造成商铺及商铺上方住户房屋部分构件受损，部分商品、家具、家电烧毁，火灾受灾户9户，火灾直接财产损失叁拾捌万肆仟贰佰零壹元伍角陆分,现场调查及询问，起火原因系11-6号商铺在商铺门口堆放有棉花包，郭梓辰（郭梓辰，男，6岁，户籍：云南省石屏县孙家寨105号，身份证号码：532525200908041715；）和袁睿希（袁睿希，男，6岁，户籍：四川省南部县，身份证号码：511321200904153479）在棉花堆玩耍时，郭梓辰使用打火机将其中一个棉花包点燃，引燃周围可燃物，蔓延成灾。', '500.00', '0', '160.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20155300001975', '云南消防总队-昆明市消防支队-嵩明县消防大队-嵩明县消防中队', '出动', '', '李伍友', '县城城区', '派出所列管单位(场所)', '批发和零售业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-嵩明县消防大队', '居住建筑', '高层', '二级', '砖混结构', '否', '否', '否', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '其他(设置,管理不符合规定)', '其他(设置,管理不符合规定)', '其他(设置,管理不符合规定)', '未联网', '电器具、设备', '否', '2015年7月5日23时39分，嵩明消防大队119报警中心接到报警称：昆明市嵩明县嵩阳镇华都酒店对面发生火灾，嵩明县消防大队迅速出动2车12人赶赴火灾现场处置。经调查，该起火灾过火210面积平方米，烧毁批发部内部分商品，造成直接经济损失100万元。火灾原因为电线短路引起火灾，无人员伤亡。', '0.00', '0', '210.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
