INSERT INTO `xf_fire_detailed` VALUES ('20155300003166', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '林喜武', '城市市区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '公共建筑', '单层', '四级以下', '其他', '否', '否', '否', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '2.00', '1.00', '设置、管理等符合规定', '未安装', '设置,管理符合规定', '未联网', '其他', '财产保险', '2015年12月27日21时55分接报警，昆明市官渡区小板桥街道办事处义路村信德物流仓库发生火灾,过火面积1200平方米。火灾烧毁彩钢板结构仓库一幢及仓库内存放的电饭锅、电磁炉、榨汁机、电线、五金工具、五辆电动车、一辆货车等商品和生活办公用品，烧损仓库外四辆汽车及东南面一段光缆电线。火灾受灾户六户，未造成人员伤亡，火灾直接财产损失伍佰陆拾柒万柒仟叁佰零壹元肆角贰分。经调查，起火原因系昆明市官渡区小板桥街道办事处义路村信德物流仓库内郑桶生户使用的电动车上的电瓶连接线发生短路，引燃电动车及周围可燃物，蔓延扩大成灾。', '5000.00', '0', '1200.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20155300003207', '云南消防总队-昆明市消防支队-禄劝县消防大队-禄劝县消防中队', '出动', '', '杨家勇', '农村(村、寨、屯等)', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-禄劝县消防大队', '居住建筑', '单层', '', '', '', '否', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '未联网', '其他', '财产保险', '2015年3月4日12时31分，两区倘甸镇海子村委会北海村204号杨家勇家发生火灾，中队在接到报警后，立即出动2车10人赶往现场处置，12时50分，中队官兵赶到现在，火灾正处于猛烈阶段，3月5日04时01分，火势得到控制，04时35分，火势得到扑灭。', '0.00', '0', '400.60', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300000052', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防二中队', '出动', '', '杨海荣', '城市市区', '二级管理单位', '交通运输', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '公共建筑', '单层', '二级', '钢砼结构', '是', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '局部安装', '有效', '2.00', '3.00', '设置、管理等符合规定', '未安装', '设置,管理符合规定', '未联网', '电器具、设备', '否', '2016年1月6日18时59分接报警，昆明市官渡区浩宏物流城18栋13号商铺发生火灾，过火面积126平方米，受灾户8户，未造成人员伤亡，火灾烧损家具家电、车辆、建筑、生活用品、设施设备等物，火灾直接财产损失332059元，经调查，起火原因系18栋13号商铺西南角屋顶电气线路发生故障，引燃13号商铺上层南侧可燃物，蔓延扩大成灾。', '1000.00', '0', '126.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300000308', '云南消防总队-昆明市消防支队-滇池国家旅游度假区消防大队-滇池国家旅游度假区消防中队', '出动', '', '万苹', '城市市区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '公共建筑', '单层', '二级', '钢砼结构', '是', '否', '否', '不需要安装', '', '不需要安装', '', '不需要安装', '', '局部安装', '无效', '10.00', '6.00', '设置、管理等符合规定', '设置,管理符合规定', '设置,管理符合规定', '未联网', '纸及其制品', '否', '2016年1月30日12时19分许，昆明市官渡区官渡街道办事处罗衙村万通综合市场发生火灾，过火面积1157.5平方米，受灾户9户。火灾烧损室内装修、营业用家具设备等商品及衣物杂品，烧损一辆奔驰汽车，烧毁一辆面包车，造成市场内部分建筑受损，未造成人员伤亡，火灾直接财产损失为2861375元整。经调查，起火原因系昆明市官渡区官渡街道办事处罗衙村万通综合市场9-5号商铺工人涂江潮在9-5号商铺内焊接钢架过程中，电焊产生的高温将9-5号商铺内南墙上与钢架紧贴的彩钢板击穿并形成熔孔。电焊产生的焊渣通过距9-5号商铺东门7.4米，距地面2.4米的熔孔掉落在9-6号商铺靠北墙的纸板堆上，将纸板堆引燃，蔓延扩大成灾。', '2000.00', '0', '1157.50', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
