INSERT INTO `xf_fire_detailed` VALUES ('20165300001225', '云南消防总队-昆明市消防支队-嵩明县消防大队-嵩明县消防中队', '出动', '', '陈瑞德', '城市市区', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-嵩明县消防大队', '工业建筑', '单层', '二级', '钢结构', '', '否', '是', '不需要安装', '其他(未启动)', '不需要安装', '其他(未启动)', '不需要安装', '其他(未启动)', '局部安装', '有效', '900.00', '13.00', '设置、管理等符合规定', '设置,管理符合规定', '设置,管理符合规定', '未联网', '竹、木等制品及原料', '否', '2016年4月20日18时17分，嵩明县公安消防大队接到报警，位于嵩明县杨林镇家具工业园区一厂房发生火灾，嵩明消防大队第一时间出动4车23人赶往现场扑救，并向昆明消防支队指挥中心请求增援， 18时35分，第一出动力量到达火灾现场，19时15分，火势得到基本控制，19时20分，昆明消防支队全勤指挥部及世博中队、特勤二中队共7车37人到达火灾现场增援，23时许明火基本扑灭。发生火灾的厂房位于嵩明县杨林镇家具工业园区12号，为单层彩钢板建筑，建筑面积900平方米，过火面积为497平方米。经调查嵩明县杨林镇家具工业园区12号厂房在对厂房房顶进行电焊过程中，电焊工王兴帅和周全超电焊操作时，产生的电火花从厂房房顶处孔洞掉落至厂内堆放的沙发垫上，引燃厂内可燃物并蔓延扩大成灾。造成经济损失387，368.00元，此次火灾未造成人员伤亡。', '2000.00', '0', '497.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001262', '云南消防总队-昆明市消防支队-东川区消防大队-东川区消防中队', '出动', '', '徐东平', '城市市区', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-东川区消防大队-东川区消防中队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其它', '财产保险', '2016年4月25日23点47分，东川中队接警称：东川区炎山路二建司小区2栋3单元门口一辆白色北京现代轿车发生火灾，中队随即出动1车7人赶赴现场实施处置，于4月26日凌晨0时38分成功将火扑灭，并于0时45分返回中队，过火面积约3㎡,无人员伤亡，直接财产损失200000元，经初步勘察在车辆静止状态下，并起火点位于右后轮处，此起火灾属交通事故，已移交交通部门处理。', '0.00', '0', '3.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001380', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队-石林县消防中队', '出动', '', '夏春林', '公路', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2016年5月7日 21时07分许，石林县昆石高速石林往昆明方向（石林服务区过去1KM），中队接警后出动3车17人，车牌号为鲁HSW087车辆，车辆由广州开往昆明，丰田车共18辆烧毁16辆，损失约400万，车辆在行驶过程中起火已移交交警部门。', '800.00', '0', '20.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001386', '云南消防总队-昆明市消防支队-安宁市消防大队-安宁市消防中队', '出动', '', '董瑞锋', '农村(村、寨、屯等)', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-安宁市消防大队', '居住建筑', '多层', '', '砖木结构', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他(家俱、设备及竹、木等制品)', '财产保险', '2016年5月7日13时45分许，安宁市县街街道办事处雁塔村民委员会雁塔村民小组民房发生火灾，火灾烧毁了董瑞锋等村民的土木结构房屋及房屋内的家俱、粮食、肥料等物品，过火门面积778.2平方米，无人员伤亡，直接财产损失166496.71元，起火原因为董瑞锋户二层房屋内长期堆放的粉末状草糠受潮不断生热蓄热，温度达到自燃点后引燃周围可燃物，蔓延扩大成灾。 备注：起火物中的“其他”是指粉末状草糠。', '0.00', '0', '778.20', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001401', '云南消防总队-昆明市消防支队-晋宁县消防大队-晋宁县消防中队', '出动', '', '吴康', '公路', '其他', '交通运输', '其他(非公有经济)', '否', '否', '云南消防总队-昆明市消防支队-晋宁县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2016年5月9日22时01分许，吴康驾驶的大众牌轿车行驶至晋宁县昆阳镇鸭口坡路段高速公路时，车辆发生侧翻后起火，经查，此起火灾属于交通事故，已移交交警部门处理。', '0.00', '0', '4.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001407', '云南消防总队-昆明市消防支队-晋宁县消防大队-晋宁县消防中队', '出动', '昆明和益泡塑包装制品制造有限公司', '', '集镇镇区', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-晋宁县消防大队', '', '单层', '二级', '钢结构', '否', '否', '否', '不需要安装', '有效', '不需要安装', '有效', '不需要安装', '有效', '全部安装', '有效', '900.00', '6.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '未联网', '塑料制品', '财产保险', '2016年5月10日9时10分左右，位于晋宁县工业园区晋城片区的昆明和益泡塑包装制品制造有限公司发生火灾事故，火灾烧损仓库、切割车间、生产原料、成品和部分设备，未造成人员伤亡。过火面积为2805㎡，直接财产损失为肆拾伍万柒仟玖佰肆拾陆元。经调查，起火原因为：2016年5月10日09时10分许罗益贤在昆明和益泡塑包装制品制造有限公司切割车间，用切割机床切割泡沫板过程中，切割线弹出的火花引燃附近堆放的泡沫板，蔓延扩大成灾。', '500.00', '0', '900.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001482', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防一中队', '出动', '', '', '农村(村、寨、屯等)', '二级管理单位', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '工业建筑', '单层', '二级', '钢砼结构', '否', '否', '是', '违反规定', '', '不需要安装', '', '不需要安装', '', '违反规定', '', '2000.00', '0.00', '设置、管理等符合规定', '设置,管理符合规定', '设置,管理符合规定', '未联网', '纸及其制品', '否', '2016年5月1日10时56分接报警，昆明市空港经济区西冲社区西冲村口昆明乐斯特包装材料有限公司厂房发生火灾，火灾烧损生产设备、原纸纸筒堆垛、叉车、货车等物品，未造成人员伤亡，直接财产损失2510660元，经调查，起火原因系电焊工汪成横、李贵杰在昆明乐斯特包装材料有限公司厂房更换位于厂房顶棚中部的水槽，在进行焊割施工作业过程中，电焊产生的火花从顶棚水槽处掉落至厂房北侧起第二至第三根立柱的原纸纸筒上，引燃原纸纸筒及周围可燃物，蔓延扩大成灾。', '2000.00', '0', '920.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001503', '云南消防总队-昆明市消防支队-五华区消防大队-五华区消防二中队', '出动', '', '黄友成', '城市市区', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-五华区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '易燃液体', '否', '2016年5月21日04:55，普吉街道办事处假日城市小区9栋1单元路口一辆摩托车着火，随后蔓延至后面的一辆凯美瑞轿车，经走访调查，查看监控录像，此次火灾系人为放火。大队已移交普吉派出所。', '2000.00', '0', '3.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001610', '云南消防总队-昆明市消防支队-寻甸县消防大队-寻甸县消防中队', '出动', '', '刘刚', '公路', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-寻甸县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2016年6月5日15时47分，寻甸大队接到报警称嵩待高速回昆明方向有一辆轿车起火（车款为丰田汉兰达车牌号：闽DZ11893），大队出动1车7人，于6月5日16时10分到达现场，经过30分钟的紧张救援，火灾被扑灭。经调查，车主系刘刚，因在行驶过程中与一辆货车发生追尾碰撞而导致车辆着火，直接财产损失150000元，过火面积2平方米，属交通事故，已移交交警部门处理。', '0.00', '0', '2.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001710', '云南消防总队-昆明市消防支队-盘龙区消防大队-盘龙区消防一中队', '出动', '', '何厚铧', '城市市区', '一级管理单位', '住宿和餐饮业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-五华区消防大队', '公共建筑', '高层', '一级', '钢砼结构', '否', '否', '是', '局部安装', '无效', '局部安装', '无效', '局部安装', '无效', '局部安装', '无效', '1000.00', '9.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '系统自动报警', '电器具、设备', '否', '2016年6月26日02时04分，昆明市五华区青年路绿岛商业中心4层昆明市五华区火吧餐厅发生火灾，无人员伤亡，火灾原因系火吧餐厅内19号餐桌烤炉使用后未关闭电源，烤炉烤燃周围可燃物，蔓延成灾，直接财产损失为1000000.', '0.00', '0', '922.20', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001842', '云南消防总队-昆明市消防支队-滇池国家旅游度假区消防大队-滇池国家旅游度假区消防中队', '出动', '', '毛艳梅', '城市市区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '公共建筑', '单层', '二级', '钢结构', '否', '否', '是', '局部安装', '有效', '局部安装', '有效', '不需要安装', '', '局部安装', '故障', '8.00', '10.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '未联网', '其他', '否', '2016年7月20日20时07分左右，昆明市官渡区小板桥街道办事处中闸村二组新圆春物流城发生火灾，过火面积240平方米，受灾户8户，未造成人员伤亡，火灾烧损仓库内存放的家庭用品、五金工具、家具家电、原料等商品及生活办公用品，造成市场内部分建筑受损，火灾直接财产损失叁拾万零伍仟壹佰肆拾贰元玖角伍分。 经调查，对起火原因认定如下2016年7月20日20时07分左右，昆明市官渡区小板桥街道办事处中闸村二组新圆春物流城发生火灾，经现场勘验和对火灾相关当事人询问，起火部位位于市场内张拥军租用的3栋14号商铺内，排除放火、雷击、小孩玩火、生活用火不慎、飞火、阴燃等引发火灾的可能，不能排除3栋14商铺内电气线路故障引发火灾的可能。', '1000.00', '0', '20.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300001917', '云南消防总队-昆明市消防支队-滇池国家旅游度假区消防大队-滇池国家旅游度假区消防中队', '出动', '', '孙贵福', '农村(村、寨、屯等)', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '公共建筑', '单层', '三级', '砖混结构', '是', '否', '否', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '5.00', '3.00', '设置、管理等符合规定', '未安装', '设置、管理等符合规定', '未联网', '纸及其制品', '否', '2016年8月2日01时27分，昆明市官渡区六甲街道办事处梁家村136号发生火灾，过火面积900平方米，受灾5户，火灾烧损印刷设备、纸张、茶具等物品及生活办公用品，烧毁部分建筑，未造成人员伤亡，直接财产损失为玖拾万零壹仟贰佰玖拾肆元柒角玖分。经调查，起火原因系2016年8月2日01时27分左右，昆明市官渡区赖金容雇用的施工队在搭建彩钢板的过程中，电焊工普金勇在昆明文协印刷有限公司旁焊接立柱时，焊渣掉落在昆明文协印刷有限公司的纸堆上，引燃周围可燃物，蔓延扩大成灾。', '2000.00', '0', '900.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
