INSERT INTO `xf_fire_detailed` VALUES ('20165300002040', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '林天勇', '集镇镇区', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '工业建筑', '单层', '四级', '其他', '否', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '设置、管理等符合规定', '设置,管理符合规定', '设置,管理符合规定', '未联网', '纸及其制品', '财产保险', '2016年8月21日23时11分许，位于昆明市经开区小石坝村802号砖厂改制区的昆明美丽好卫生用品有限公司发生火灾，火灾烧损彩钢板建筑，烧毁卫生纸生产设备及部分成品，未造成人员伤亡，过火面积2500平方米,火灾直接财产损失2717396元。经现场勘验和对火灾相关当事人询问，此次火灾起火点为复卷车间内1、2号复卷机与南墙之间的西南角处。排除雷击、原纸自燃、阴燃、用火不慎、吸烟、小孩玩火、放火引发火灾的可能,不能排除电气线路故障等电气原因引发火灾的可能.起火建筑为彩钢板搭建的厂房。', '0.00', '0', '2500.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002114', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防二中队', '出动', '', '李文柱', '城市市区', '二级管理单位', '', '', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '居住建筑', '多层', '二级', '砖混结构', '否', '否', '否', '不需要安装', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '家俱', '否', '：2016年9月2日20时46分，昆明市官渡区民航路香樟俊园13栋1单元402室发生火灾，过火面积25平方米，受灾户2户，火灾烧损衣物、电器、家具、电脑、打印机等生活及办公用品，造成房屋结构部分受损，无人员伤亡，火灾直接财产损失贰拾壹万贰仟叁佰陆拾柒元陆角叁分。经调查，起火原因系2016年9月2日20时41分许，昆明市官渡区民航路香樟俊园13栋1单元402室发生火灾，起火原因系402室户主李文柱在家内衣物间给摄像机充电，由于长时间通电导致摄像机发热起火，引燃旁边可燃物，蔓延扩大成灾。', '500.00', '0', '20.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002157', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队-石林县消防中队', '出动', '', '杨树云', '城市市区', '派出所列管单位(场所)', '住宿和餐饮业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队', '公共建筑', '多层', '四级', '木结构', '否', '否', '是', '全部安装', '其他(未启动)', '违反规定', '', '不需要安装', '', '全部安装', '有效', '1786.00', '5.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '未联网', '其他(建筑构件、材料)', '', '2016年9月9日03时20分，石林县彝族自治县鹿阜街道办事处台创园万家欢农业开发有限公司野奢木屋酒店发生火灾，中队出动4车19名官兵前往火场处置，火灾于当日08时30分扑灭，火灾烧毁木结构房屋1栋、部分电器、床及被褥等，过火面积为600平方米，直接财产损失为400000余元，无人员伤亡，火灾原因是纵火案。', '1000.00', '0', '600.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002267', '云南消防总队-昆明市消防支队-特勤大队-特勤二中队', '出动', '', '赵官权', '公路', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '未联网', '其他', '财产保险', '2016年9月28日04时57分许，接报警称洛阳往王家营方向一辆行驶过程中的汽车（车牌号：云A6TQ08）发生火灾。火灾过火面积1.5平方米，火灾中烧损车身前部部分，火灾直接财产损346000元。经调查起火原因系汽车在行驶过程中撞到水泥墩后自然引起火灾。因起火场所为轿车，建筑结构不能选择。（属于交通事故，移交交警部门）。', '0.00', '0', '1.50', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002275', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防二中队', '出动', '', '许卫强', '城市市区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '工业建筑', '单层', '二级', '钢砼结构', '是', '否', '否', '违反规定', '', '违反规定', '', '违反规定', '', '违反规定', '', '10.00', '6.00', '设置、管理等符合规定', '未安装', '设置,管理符合规定', '未联网', '其他', '财产保险', '2016年9月28日11时05分许，昆明市官渡区关上街道办事处和甸营村张方军经营的仓库区发生火灾，经现场勘验和对火灾相关当事人询问，起火部位位于张方军经营的仓库区许卫强租用的仓库内，排除放火、雷击、小孩玩火、生活用火不慎、飞火、阴燃等引发火灾的可能，不能排除许卫强租用的仓库内电气线路故障引发火灾的可能。', '30000.00', '0', '3000.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002368', '云南消防总队-昆明市消防支队-呈贡县消防大队-呈贡县消防中队', '出动', '银泰家具制造有限公司', '', '县城城区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-呈贡县消防大队', '公共建筑', '单层', '四级', '其他', '是', '否', '否', '不需要安装', '其他(未启动)', '不需要安装', '', '不需要安装', '', '不需要安装', '其他(未启动)', '0.00', '0.00', '设置、管理等符合规定', '设置,管理符合规定', '设置,管理符合规定', '未联网', '电器具、设备', '否', '2016年10月13日11时15分许，位于昆明市呈贡区雨花街道办事处下庄社区大梨园村银泰家具制造有限公司厂房发生火灾，火灾共烧毁彩钢板厂房2栋，板房内办公家具、生产机器、成品门、包装纸等物品，起火部位位于昆明银泰家具有限公司厂房东北角附近处，排除防火、小孩玩火、雷击、生活用火不慎等引发火灾的可能，不能排除电气线路故障引发火灾的可能。火灾未造成人员伤亡，直接财产损失为171991.60元（壹拾柒万壹仟玖佰玖拾壹元陆角）。', '0.00', '0', '900.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
