INSERT INTO `xf_fire_detailed` VALUES ('20165300002865', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '邓双美', '县城城区', '派出所列管单位(场所)', '', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '工业建筑', '多层', '二级', '其他', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '否', '2016年12月8日17时34分许，昆明市经开区大洛羊联运大道的巧修停车场邓双美经营的轮胎销售部发生火灾，火灾烧损彩钢板建筑、轮胎、设备及部分生活用品，过火面积160平方米，未造成人员伤亡,直接财产损失为481515元,经调查起火原因系昆明市经开区大洛羊联运大道的巧修停车场邓双美经营的轮胎销售部二楼自南向北第一间房间距西墙门口70cm，紧靠南墙墙面处电线发生短路，引燃周围纸箱、衣服等可燃物，蔓延扩大成灾。起火建筑为彩钢板建筑。', '0.00', '0', '160.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300002992', '云南消防总队-昆明市消防支队-宜良县消防大队-宜良县消防中队', '出动', '', '佘德学', '城市市区', '二级管理单位', '', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-宜良县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '未联网', '其他', '否', '2016年12月20日0时34分，宜良消防大队接到报警称：昆石高速木喳箐路段发生火灾，接警后，中队出动2车14人赶赴现场处置。火灾原因系货车（云D81128）在下坡途中轮胎与路面摩擦过大轮胎起火引发的，直接财产损失420000元，过火面积27平方米。经调查属于交通事故，已移交交通部门处理。', '0.00', '0', '27.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300003004', '云南消防总队-昆明市消防支队-寻甸县消防大队-寻甸县消防中队', '出动', '', '张世洪', '县城城区', '派出所列管单位(场所)', '商务服务业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-寻甸县消防大队', '公共建筑', '单层', '四级', '其他', '是', '否', '否', '违反规定', '', '违反规定', '', '不需要安装', '', '违反规定', '', '423.00', '10.00', '其他(设置、管理等不符合规定)', '其他(设置、管理等不符合规定)', '其他(设置、管理等不符合规定)', '未联网', '塑料制品', '否', '2016年12月20日23时18分，寻甸县消防大队接到报警称，寻甸县仁德镇新农贸市场发生火灾，接警后，寻甸中队5车17人赶赴现场处置。2016年12月21日2时30分，现场明火扑灭，经调查，涉及受灾户8户，火灾烧损15间商铺，过火面积423平方米，火灾原因为：寻甸县仁德镇旭东路新农贸市场3区3幢13号商铺杨红斌家卷帘门上方由市场管理方敷设的主电力线西侧导线发生短路，引燃3区3幢13号商铺内堆放在二层的塑料快餐盒、竹签、一次性筷子等可燃物，蔓延扩大成灾，无人员伤亡，直接财产损失为1815877元.', '0.00', '0', '423.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300003008', '云南消防总队-昆明市消防支队-呈贡县消防大队-呈贡县消防中队', '出动', '', '', '县城城区', '派出所列管单位(场所)', '仓储业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-呈贡县消防大队', '公共建筑', '单层', '四级以下', '其他', '是', '否', '否', '不需要安装', '其它(未启动)', '不需要安装', '其它(未启动)', '不需要安装', '', '不需要安装', '其它(未启动)', '0.00', '0.00', '其他(设置、管理等不符合规定)', '', '设置,管理符合规定', '未联网', '电器具、设备', '否', '2016年12月21日10时15分许，昆明市呈贡区斗南街道小梅子村竹子市场河北鹏辉塑料制品厂发生火灾。火灾烧毁板房内办公用具（桌椅、柜子等），生活起居物品（床、炊具），生产加工机器，包装纸箱，各类原材料、生产加工半成品、成品等物品，未造成人员伤亡。直接财产损失为壹佰贰拾万捌仟捌佰贰拾壹元伍角捌分整，。火灾原因系河北鹏辉塑料制品厂的低压动力电线与该厂生产区西北墙左侧砖墙上的彩钢瓦发生短路，引燃下方堆放的塑料原料堆垛及周围可燃物，蔓延扩大成灾。', '0.00', '0', '2120.70', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20165300003057', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '杨皓', '公路', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2016年12月27日13时37分许，经开中队接报警称昆明往石林方向小喜村收费站汽车发生火灾，火灾烧损一辆宝马车，过火面积5平方米，未造成人员伤亡，火灾直接财产损失20万元，起火原因系起火车辆被后面车辆追尾后撞到汽车电瓶后引发起火。因起火场所为轿车，建筑结构不能选择。（属于交通事故，移交交警部门）', '0.00', '0', '5.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20175300000084', '云南消防总队-昆明市消防支队-宜良县消防大队-宜良县消防中队', '出动', '', '', '公路', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-宜良县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2017年1月13日06时20分，宜良县消防大队接到报警称：宜良县昆石高速宜良往石林方向距离石林10公里路段一货车生火灾，中队出动2车14人赶赴现场处置。经调查，起火经过为驾驶员常自波驾驶一货车（车牌号为：渝DY5819）拉运安能快递公司的快递，从昆明出发至蒙自，在行驶过程中，驾驶员发现货箱起火，驾驶员怀疑货箱内拉有易燃易爆物品引起，无人员伤亡，根据相关规定，已移交交警部门处理。', '0.00', '0', '23.40', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20175300000340', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '余家国', '城市市区', '开发区、旅游区', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '', '多层', '二级', '砖混结构', '否', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '未联网', '竹、木等制品及原料', '否', '2017年1月31日21时27分，昆明市公安消防支队经济技术开发区大队经开中队接报警称：昆明市经开区阿拉街道办事处西邑村胜盟家具厂发生火灾，火灾烧毁制作家具用布制品、木料制品、缝纫机等缝纫设备、沙发成品及半成品、裁剪设备、装修装饰物等物品，过火面积386平方米，受灾户4户，未造成人员伤亡,直接财产损失为捌拾万叁仟柒佰伍拾贰元伍角。经调查，对起火原因认定如下： 2017年1月31日21时18分左右，昆明市经开区阿拉街道办事处西邑村胜盟家具厂二楼平台临时搭建的彩钢瓦建筑东侧铁皮墙体处电线发生短路，引燃周围海绵、沙发布等可燃物，蔓延扩大成灾。', '0.00', '0', '386.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20175300000539', '云南消防总队-昆明市消防支队-寻甸县消防大队-寻甸县消防中队', '出动', '', '张关凤', '县城城区', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-寻甸县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其它', '财产保险', '2017年2月7日16时51分13秒，寻甸县消防大队接报警称：寻甸县县委老党校住宿区内车辆着火， 接警后，寻甸中队迅速调集2 车7人赶赴现场处置, 2017年2月7日17时30分许将现场明火扑灭, 初步调查,过火面积30㎡，受灾3户,火灾烧损福田牌货车1辆、东风日产骐达牌轿车1辆及车内饮料、酒水、生活用纸、副食品等部分物品,无人员伤亡，直接财产损失为197201元。经现场勘验和对火灾当事人询问，起火部位位于东风日产骐达牌轿车车头前方水泥砖房东侧墙角堆放塑料筐处，排除电气线路故障、自燃、雷击、机械故障等引发火灾的可能，不能排除小孩玩火、飞火等引发火灾的可能。', '0.00', '0', '1.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
