INSERT INTO `xf_fire_detailed` VALUES ('20185300000855', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防二中队', '出动', '', '李晓羽', '城市市区', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2018年1月25日05时33分接报警，昆明市官渡区云南官房建设集团物资供应部一辆停放的重型半挂牵引车发生火灾，过火面积4平方米，受灾1户，火灾烧毁重型半挂牵引车（车牌号：云F56405）一辆，造成一人死亡（李晓羽，男，30岁，汉族，身份证号码：530124198807121118，籍贯：云南省富民县）,火灾直接财产损失拾玖万贰仟柒佰元。经调查，对起火原因认定如下：2018年1月25日05时21分许，昆明市官渡区云南官房建设集团物资供应部一辆停放的重型半挂牵引车（车牌号：云F56405）发生火灾，经现场勘验和对火灾相关当事人询问，起火部位位于重型半挂牵引车车头处，排除雷击、飞火、小孩玩火、用火不慎等引发火灾的可能，不能排除放火、电气线路故障等引发火灾的可能。', '200.00', '0', '4.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
