INSERT INTO `xf_fire_detailed` VALUES ('20185300004044', '云南消防总队-昆明市消防支队-盘龙区消防大队-盘龙区消防二中队', '出动', '', '雷少明', '城市市区', '派出所列管单位(场所)', '批发和零售业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-盘龙区消防大队', '公共建筑', '单层', '二级', '砖混结构', '否', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '', '', '', '', '植物纤维及其制品', '否', '2018年4月26日09时54分，昆明市公安消防支队盘龙区大队接到报警称：昆明市盘龙区穿金路263号化工机械厂家属小区1号铺面发生火灾，过火面积20平方米，受灾户2户，未造成人员伤亡，火灾烧损茶叶、家具等物品，火灾直接财产损失为壹佰零陆万壹仟陆佰壹拾元整，起火原因系赵小波使用电焊机在焊接油烟管道过程中焊渣穿过屋顶石棉瓦裂缝掉进雷少明经营的1号铺面，引燃店铺内茶叶等物品，蔓延扩大成灾。', '0.00', '0', '20.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
