INSERT INTO `xf_fire_detailed` VALUES ('20185300005181', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防一中队', '出动', '', '闫楠', '开发区、旅游区', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '工业建筑', '单层', '四级', '其他', '否', '否', '否', '不需要安装', '', '违反规定', '', '不需要安装', '', '违反规定', '', '20.00', '5.00', '设置、管理等符合规定', '未安装', '设置,管理符合规定', '未联网', '其他(易燃、易爆物品)', '否', '2018年8月8日接报警称：昆明市空港经济区园艺场天马化工责任有限公司生产厂房发生火灾，火灾烧毁塑料桶、成品白乳胶、白乳胶制作原料、反应炉，烧损部分建筑结构，过火面积70平方米，直接财产损失487985元,未造成人员伤亡，经调查，起火原因系厂房内反应炉区域距离南墙1.2米、东侧第二根立柱1.8米处电线发生短路，引燃反应炉表面包裹层，扩散成灾。', '0.00', '0', '70.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
