INSERT INTO `xf_fire_detailed` VALUES ('20195300001693', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队-石林县消防中队', '出动', '', '张兴', '城市市区', '派出所列管单位(场所)', '', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队', '居住建筑', '多层', '', '居住建筑', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '吊顶（顶棚）', '财产保险', '2019年3月03日15时30分许，石林彝族自治县鹿阜街道办事处堡子村委会堡子前街62号发生火灾，中队出动3车14名消防员前往火场扑救，建筑结构为土木结构房屋，受灾10户，过火面积750余平方米，未造成人员伤亡，火灾烧毁部份房屋、家具家电、外墙、生活用品、货柜、农药及其他物品等财物，直接财产损失为叁拾柒万肆仟柒佰肆拾陆元整。', '0.00', '0', '750.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
