INSERT INTO `xf_fire_detailed` VALUES ('20195300002484', '云南消防总队-昆明市消防支队-晋宁县消防大队-晋宁县消防中队', '出动', '', '宋睿', '集镇镇区', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-晋宁县消防大队', '农业建筑', '', '', '', '是', '是', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '1.00', '3.00', '设置、管理等符合规定', '设置、管理等符合规定', '设置、管理等符合规定', '未联网', '墙壁及其装饰', '否', '2019年4月8日14时37分，晋宁大队接警称：云南乐彩农业科技有限公司着火，接警后大队立即组织力量赶赴现场进行处置。经查起火部位位于云南乐彩农业科技有限公司生产加工车间内距南墙4.2米，距西墙2.3米处，排除放火、雷击、电气线路故障、小孩玩火、生活用火不慎、静电、飞火等引发火灾的可能，不能排除甲醇、聚乙二醇、甘油、冰醋酸、双氧水、水等物质混合液，长时间存放在密闭的泡池内，大量蓄热，在操作过程中搅动溶液大量放热，发生爆燃引发火灾的可能。未造成人员伤亡，过火面积1000平方米，直接财产损失838524元。', '1000.00', '0', '1000.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300003927', '云南消防总队-昆明市消防支队-西山区消防大队-西山区消防二中队', '出动', '', '徐洪兴', '城市市区', '其他', '', '', '否', '否', '云南消防总队-昆明市消防支队-西山区消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '露天堆垛', '否', '2019年5月25日17时29分许，昆明市西山区马街街道办事处百集龙广场后面发生火灾，起火原因为施星昌在百集龙A2地块空地上搭建的彩钢板空房房顶东南角处，用氧气切割顶梁时，火星飞落东侧草丛，引燃周边可燃物，无人员伤亡，火灾直接财产损失2317620元，过火面积500平方米。', '10000.00', '0', '500.00', '0', '已挂接', '无案例', '特大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300004102', '云南消防总队-昆明市消防支队-经济技术开发区消防大队-经济技术开发区消防中队', '出动', '', '张猛兵', '农村(村、寨、屯等)', '派出所列管单位(场所)', '制造业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-经济技术开发区消防大队', '居住建筑', '单层', '三级', '其他', '是', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '违反规定', '', '500.00', '4.00', '设置、管理等符合规定', '未安装', '设置,管理符合规定', '未联网', '棉、麻、丝纤维', '否', '2019年6月2日20时8分许，昆明经开区阿拉街道办事处石坝社区大石坝村昆明布同沙发有限公司发生火灾，火灾烧损两栋彩钢板建筑及两栋民房，烧毁沙发成品、半成品、床垫及部分机器设备等物品，未造成人员伤亡，火灾过火面积673平方米,火灾直接财产损失451460.21元，原因系昆明布同沙发有限公司二层的靠近西墙转角处的电线短路起火，引燃周围海绵等可燃物，蔓延扩大成灾。', '0.00', '0', '673.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300004537', '云南消防总队-昆明市消防支队-官渡区消防大队-官渡区消防一中队', '出动', '', '刘忠彪', '县城城区', '派出所列管单位(场所)', '批发和零售业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-官渡区消防大队', '工业建筑', '单层', '四级以下', '其他', '是', '否', '否', '违反规定', '', '违反规定', '', '不需要安装', '', '违反规定', '', '0.00', '0.00', '设置、管理等符合规定', '未安装', '设置、管理等符合规定', '未联网', '其他(轻工业品、纺织品)', '否', '2019年06月27日05时31分，空港经济区李其社区黑波村居民小组小林场发生火灾，过火面积120平方米，直接财产损失496528元，未造成人员伤亡，经调查，起火点位于刘忠彪经营的五金店内，起火原因排除雷击、小孩玩火、吸烟、电器线路故障，不排除遗留火种和放火。', '0.00', '0', '120.00', '0', '已挂接', '无案例', '重大火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300004728', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队-石林县消防中队', '出动', '', '卢云祥', '农村(村、寨、屯等)', '派出所列管单位(场所)', '', '', '否', '否', '云南消防总队-昆明市消防支队-石林彝族自治县消防大队', '居住建筑', '单层', '', '砖混结构', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其他', '财产保险', '2019年7月12日05时37分许，昆明市石林彝族自治县西街口镇芭茅村273号民房发生火灾，过火面积40平方米，火灾烧毁部份零售食品、货柜、日用百货等物品；烧损部份房屋室内装修、床、电视机、电脑等生活用品，死亡2人，受重伤1人，直接财产损失为壹拾玖万零玖佰捌拾贰元贰角整。', '200.00', '0', '40.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300005182', '云南消防总队-昆明市消防支队-宜良县消防大队-宜良县消防中队', '出动', '', '谢雁清', '农村(村、寨、屯等)', '二级管理单位', '', '', '否', '否', '云南消防总队-昆明市消防支队-宜良县消防大队', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0.00', '0.00', '', '', '', '', '其它', '财产保险', '2019年8月17日04时19分接到报警称：宜良县宜马公路马街镇平田村路段汽车着火，中队出动2车14人赶往现场处置，经调查，火灾原因：系车主谢雁清（车牌号：云H27280）驾驶水泥罐车在行驶过程中由于车辆线路短路导致驾驶室冒烟，此次火灾无人员受伤、伤亡，车主对火灾原因无异议。该起火灾属于交通事故（机械故障），已移交交警部门处理。', '0.00', '0', '3.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
INSERT INTO `xf_fire_detailed` VALUES ('20195300005787', '云南消防总队-昆明市消防支队-呈贡县消防大队-呈贡县消防中队', '出动', '呈贡区龙城街道龙街社区', '', '城市市区', '其他', '住宿和餐饮业', '私有经济', '否', '否', '云南消防总队-昆明市消防支队-呈贡县消防大队', '公共建筑', '单层', '四级以下', '其他', '是', '否', '是', '不需要安装', '', '不需要安装', '', '不需要安装', '', '不需要安装', '', '0.00', '0.00', '设置、管理等符合规定', '其他(设置,管理不符合规定)', '设置,管理符合规定', '未联网', '油脂类', '否', '2019年9月27日19时55分许，昆明市消防支队119指挥中心接到电话报警称：“呈贡区兴呈路6085号发生火灾”，火灾过火面积约50平方米，烧毁彩钢瓦搭建房屋、厨房用品、酒水、食材、工具等物品，未造成人员伤亡，直接财产损失为贰拾万零玖仟柒佰零伍元伍角壹分整。经现场勘验及当事人证实，2019年9月27日19时50分许，彭志鲜在位于呈贡龙城街道办事处龙街社区呈贡区兴呈路6085号兰治龙经营的呈贡兰治龙小吃店内，炼油过程中，由于操作当不引起油锅起火，引燃彭志鲜用来盖住油锅的衣服及店内操作间塑料扣板等可燃物，蔓延扩大成灾。', '0.00', '0', '50.00', '0', '已挂接', '无案例', '一般火灾', '一般火灾');
