-- ----------------------------
-- Table structure for xf_fire_detailed
-- ----------------------------
DROP TABLE IF EXISTS `xf_fire_detailed`;
CREATE TABLE `xf_fire_detailed` (
  `id` varchar(255) NOT NULL COMMENT '火灾序号',
  `fire_name` varchar(200) DEFAULT NULL COMMENT '消防队名称',
  `dispatch` varchar(15) DEFAULT NULL COMMENT '出动情况',
  `company_name` varchar(200) DEFAULT NULL COMMENT '单位名称',
  `user_name` varchar(25) DEFAULT NULL COMMENT '户主名',
  `region` varchar(100) DEFAULT NULL COMMENT '区域',
  `classification` varchar(150) DEFAULT NULL COMMENT '分级管理',
  `industry` varchar(80) DEFAULT NULL COMMENT '行业类别',
  `economics` varchar(20) DEFAULT NULL COMMENT '经济类型',
  `heritage` varchar(10) DEFAULT NULL COMMENT '是否属世界遗产',
  `investigation` varchar(10) DEFAULT NULL COMMENT '是否正在调查',
  `brigade` varchar(255) DEFAULT NULL COMMENT '负责调查支队(大队)',
  `nature_usage` varchar(25) DEFAULT NULL COMMENT '建筑使用性质',
  `category` varchar(25) DEFAULT NULL COMMENT '建筑类别',
  `refractory` varchar(50) DEFAULT NULL COMMENT '建筑耐火等级',
  `structure` varchar(50) DEFAULT NULL COMMENT '建筑结构',
  `spread` varchar(5) DEFAULT NULL COMMENT '火灾从失火建筑蔓延到临近建筑',
  `flashover` varchar(5) DEFAULT NULL COMMENT '发生轰燃',
  `process` varchar(5) DEFAULT NULL COMMENT '失火建筑门窗在火灾过程中开启',
  `alarm_install` varchar(35) DEFAULT NULL COMMENT '报警系统安装',
  `alarm_up` varchar(35) DEFAULT NULL COMMENT '报警系统启动',
  `fighting_install` varchar(35) DEFAULT NULL COMMENT '灭火系统安装',
  `fighting_up` varchar(35) DEFAULT NULL COMMENT '灭火系统启动',
  `smoke_install` varchar(35) DEFAULT NULL COMMENT '防排烟系统安装',
  `smoke_up` varchar(35) DEFAULT NULL COMMENT '防排烟系统启动',
  `hydrant_install` varchar(35) DEFAULT NULL COMMENT '消火栓系统安装',
  `hydrant_up` varchar(35) DEFAULT NULL COMMENT '消火栓系统启动',
  `fire_compartment` double(255,2) DEFAULT NULL COMMENT '防火分区',
  `fire_spacing` double(255,2) DEFAULT NULL COMMENT '防火间距',
  `escape_route` varchar(100) DEFAULT NULL COMMENT '疏散通道',
  `lighting` varchar(100) DEFAULT NULL COMMENT '应急疏散照明',
  `emergency_exit` varchar(100) DEFAULT NULL COMMENT '紧急出口',
  `networking` varchar(30) DEFAULT NULL COMMENT '与城市报警系统联网情况',
  `fire_object` varchar(50) DEFAULT NULL COMMENT '起火物',
  `Insurance` varchar(20) DEFAULT NULL COMMENT '保险情况',
  `fire_passes` text COMMENT '起火经过',
  `disposal_cost` double(10,2) DEFAULT NULL COMMENT '现场处置费用',
  `personal_injury` int(255) DEFAULT NULL COMMENT '人身伤亡',
  `burned_area` double(255,2) DEFAULT NULL COMMENT '过火面积',
  `minor_wound` int(255) DEFAULT NULL COMMENT '轻伤人数',
  `hang_up` varchar(20) DEFAULT NULL COMMENT '是否挂接',
  `fire_case` varchar(25) DEFAULT NULL COMMENT '是否有案例',
  `major` varchar(35) DEFAULT NULL COMMENT '是否特重大火灾(旧标准)',
  `fire_rating` varchar(35) DEFAULT NULL COMMENT '火灾等级(新标准)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xf_fire_detailed
-- ----------------------------

-- ----------------------------
-- Table structure for xf_fire_manager
-- ----------------------------
DROP TABLE IF EXISTS `xf_fire_manager`;
CREATE TABLE `xf_fire_manager` (
  `id` varchar(255) NOT NULL COMMENT '火灾序号',
  `region` varchar(150) DEFAULT NULL COMMENT '行政区域编码',
  `place` varchar(255) DEFAULT NULL COMMENT '起火地点',
  `fire_date` datetime DEFAULT NULL COMMENT '起火时间',
  `fire_place` varchar(100) DEFAULT '' COMMENT '起火场所',
  `reason_category` varchar(255) DEFAULT NULL COMMENT '火灾原因分类',
  `company` varchar(100) DEFAULT NULL COMMENT '单位代码',
  `households` int(255) DEFAULT NULL COMMENT '受灾户数',
  `property_loss` double DEFAULT NULL COMMENT '直接财产损失',
  `Injured` int(11) DEFAULT NULL COMMENT '受伤人数',
  `death` int(11) DEFAULT NULL COMMENT '死亡人数',
  `audit_status` varchar(15) DEFAULT NULL COMMENT '审核状态',
  `investigation` varchar(10) DEFAULT NULL COMMENT '正在调查',
  `coordinate_x` double DEFAULT NULL COMMENT 'X坐标',
  `coordinate_y` double DEFAULT NULL COMMENT 'Y坐标',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

